import { getDefaultNormalizer } from '@testing-library/dom';
import styled from 'styled-components';

export default Equi = styled.div`
background: black;
border-radius: 50%;
width: 1080px;
height: 1080px;
border: 5px solid white;
margin-top: 120px;
position: absolute;
display: flex;
justify-content: center;
`
